var _traceDepth = 0;
var _tracing = false;

function _ruleInit () {
}

function _traceSpaces () {
    var s = '';
    var n = _traceDepth;
    while (n > 0) {
        s += ' ';
        n -= 1;
    }
    s += `[${_traceDepth.toString ()}]`;
    return s;
}

function _ruleEnter (ruleName) {
    if (_tracing) {
        _traceDepth += 1;
        var s = _traceSpaces ();
        s += 'enter: ';
        s += ruleName.toString ();
        console.log (s);
    }
}

function _ruleExit (ruleName) {
    if (_tracing) {
        var s = _traceSpaces ();
        _traceDepth -= 1;
        s += 'exit: ';
        s += ruleName.toString ();
        console.log (s);
    }
}

function extractFormals (s) {
    var s0 = s
        .replace (/\n/g,',')
        .replace (/[A-Za-z0-9_]+ = /g,'')
        .replace (/\.[^;]+;/g,'')
        .replace (/,/,'')
	.replace (/var /g,'')
    ;
    return s0;
}

